//// OUTPUT MODULE ////////////////////////////////\r","///////////////////////////////////////////////////////////////////////////////\r","\r","\r","/** @addtogroup NXTFirmwareModules\r"," * @{\r"," */\r","/** @addtogroup OutputModule\r"," * @{\r"," */\r","/** @defgroup OutputModuleFunctions Output module functions\r"," * Functions for accessing and modifying output module features.\r"," * @{\r"," */\r","/**\r"," * Reset tachometer counter.\r"," * Reset the tachometer count and tachometer limit goal for the specified\r"," * outputs.\r"," *\r"," * \\param _p Desired output ports. Can be a constant or a variable, see\r"," * \\ref OutputPortConstants. For multiple outputs at the same time\r"," * you need to add single output port values into a byte array and pass the array\r"," * instead of a single numeric value.\r"," */\r","#define ResetTachoCount(_p) __resetTachoCount(_p)\r","\r","/**\r"," * Reset block-relative counter.\r"," * Reset the block-relative position counter for the specified outputs.\r"," *\r"," * \\param _p Desired output ports. Can be a constant or a variable, see\r"," * \\ref OutputPortConstants. For multiple outputs at the same time\r"," * you need to add single output port values into a byte array and pass the array\r"," * instead of a single numeric value.\r"," */\r","#define ResetBlockTachoCount(_p) __resetBlockTachoCount(_p)\r","\r","/**\r"," * Reset program-relative counter.\r"," * Reset the program-relative position counter for the specified outputs.\r"," *\r"," * \\param _p Desired output ports. Can be a constant or a variable, see\r"," * \\ref OutputPortConstants. For multiple outputs at the same time\r"," * you need to add single output port values into a byte array and pass the array\r"," * instead of a single numeric value.\r"," */\r","#define ResetRotationCount(_p) __resetRotationCount(_p)\r","\r","/**\r"," * Reset all tachometer counters.\r"," * Reset all three position counters and reset the current tachometer limit\r"," * goal for the